def extended_euclid(a, b):
    if b == 0:
        return 1, 0
    else:
        x, y = extended_euclid(b, a % b)
        return y, x - (a // b) * y

def main():
    a, b = map(int, input().split())
    x, y = extended_euclid(a, b)
    print(x, y)

if __name__ == "__main__":
    main()

