def leap_years_between(a, b):
    leap_years = []
    for year in range(a, b+1):
        if (year % 4 == 0 and year % 100 != 0) or year % 400 == 0:
            leap_years.append(year)

    if len(leap_years) == 0:
        print("NA")
    else:
        for year in leap_years:
            print(year)

def main():
    while True:
        a, b = map(int, input().split())
        if a == 0 and b == 0:
            break
        leap_years_between(a, b)
        print()

if __name__ == "__main__":
    main()

